// src/pages/MySubmissions.js
import React, { useEffect, useState } from "react";
import axios from "axios";
import { Link, useNavigate } from "react-router-dom";
import { useAuth } from "../context/AuthContext";

const API_URL = "http://localhost:5000";

function MySubmissions() {
  const { user, token } = useAuth();
  const navigate = useNavigate();

  const [submissions, setSubmissions] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  useEffect(() => {
    if (!user) {
      navigate("/login", {
        state: { from: "/submissions", message: "You must be logged in" },
      });
      return;
    }

    async function fetchSubmissions() {
      try {
        setLoading(true);
        const res = await axios.get(`${API_URL}/submissions/mine`, {
          headers: { Authorization: `Bearer ${token}` },
        });
        setSubmissions(res.data || []);
      } catch (err) {
        console.error("Fetch submissions error:", err);
        setError("Failed to load your submissions.");
      } finally {
        setLoading(false);
      }
    }

    fetchSubmissions();
  }, [user, token, navigate]);

  const getStatusClass = (status) => {
    if (!status) return "pill pill-muted";
    const s = status.toLowerCase();
    if (s === "accepted") return "pill pill-accepted";
    if (s === "rejected") return "pill pill-rejected";
    return "pill pill-pending";
  };

  const formatDate = (dateStr) => {
    if (!dateStr) return "-";
    const d = new Date(dateStr);
    return d.toLocaleString();
  };

  if (!user) return null;

  return (
    <div className="page-container">
      <div className="page-card">
        <h1 className="page-heading">My Submissions</h1>
        <p className="page-subtitle">
          Track your progress across all problems you&apos;ve attempted on{" "}
          <span className="auth-brand">CodeGen4Future</span>.
        </p>

        {loading && <p className="page-muted">Loading submissions...</p>}
        {error && <p className="page-error">{error}</p>}

        {!loading && submissions.length === 0 && !error && (
          <div className="empty-state">
            <p>You haven&apos;t submitted any solutions yet.</p>
            <Link to="/problems" className="btn btn-primary">
              Solve your first problem
            </Link>
          </div>
        )}

        {!loading && submissions.length > 0 && (
          <div className="submissions-table-wrapper">
            <table className="submissions-table">
              <thead>
                <tr>
                  <th>Problem</th>
                  <th>Status</th>
                  <th>Language</th>
                  <th>Submitted At</th>
                  <th>View</th>
                </tr>
              </thead>
              <tbody>
                {submissions.map((sub) => (
                  <tr key={sub._id}>
                    <td>
                      {sub.problem ? (
                        <Link
                          to={`/problems/${sub.problem.slug}`}
                          className="table-link"
                        >
                          {sub.problem.title}
                        </Link>
                      ) : (
                        <span className="page-muted">[Deleted Problem]</span>
                      )}
                    </td>
                    <td>
                      <span className={getStatusClass(sub.status)}>
                        {sub.status || "Unknown"}
                      </span>
                    </td>
                    <td>
                      <span className="pill pill-lang">
                        {sub.language?.toUpperCase()}
                      </span>
                    </td>
                    <td className="submitted-time">
                      {formatDate(sub.createdAt)}
                    </td>
                    <td>
                      {sub.problem && (
                        <Link
                          to={`/problems/${sub.problem.slug}`}
                          className="btn btn-ghost-sm"
                        >
                          Open
                        </Link>
                      )}
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}
      </div>
    </div>
  );
}

export default MySubmissions;
